import React, { Component } from 'react';
import PropTypes from 'prop-types'
import './App.css';
import Header from './component/Head'
import Contents from './component/content'
import ThemeSwitch from './themeColor'


class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Contents />
        <ThemeSwitch />
      </div>
    );
  }
}

export default App;
